@nicolasberrod @franceinfo Jadot, je suis Vert... de honte et de rage.
Ce que tu viens d'avouer, de commettre en cette seconde, ton adhésion au totalitarisme, à la négation de la liberté individuelle et aux Droits de l'Homme sont inoubliables.
Aie au moins l'élégance de dégager sans y être obligé...
